import React, { Component } from "react";
import { Link } from "react-router-dom";
import Parks from "./parks.json";

class parkcomponent extends Component {
  render() {
    let AllParks = Parks.forEach(park => {
      return park.name;
    });
    return;
    <div> {AllParks}</div>;
  }
}

export default parkcomponent;
